content:
글씨가 크다는 것도 못 느꼈고 오히려 잘 보고 있었어요~
댓글 좀 살펴보니 다들 오히려 커서 좋았다는데 누가 그런건지;
다른분 말마따나 세심하게 챙겨주시는게 감동이네요~

긴시간..감사했어요^^;;
좋은만화..처음과 끝 함께 할수있어서
제게는 크나큰 영광이였습니다.

정말 열심히 보면서 댓글 한번 제대로 안 남겨 드렸네요^^
 제주 살당 육지 올라왕 사는 사람인디 살멍도 몰랐던 이야기를 여기서 보멍 혼자 막 지꺼젼 마씨~~ 작가님. 그리시는거 보멍 제주 사람인가 해신디, 이거저거 보난 아닌거 아란마씨~~ 경해도 너무 곱게 그려주고 해그네 막 감사해마씨~~ ^^
 앞으로도 좋은 작품 부탁드리고 고생 많으셨습니다^^;;

ʕʘ̅͜ʘ̅̅ʔ 
2020년 5월 15일 
아무것도 뚫지 못하는 창 &#x27;삼성&#x27; 
vs 아무것도 막지 못하는 방패 &#x27;KT&#x27;
경기에서 6:14로 방패가 이겼습니다..
